import ExpemseItem from './Components/ExpenseItem';

function App() {
    let expenseDate = new Date(2012, 3 ,24 );
    let expenseTitle = "Buy Books";
    let expemseAmount = 300;
    return (
        <div>
            <ExpemseItem 
            date={expenseDate}  // passing the data as a variable
            title={expenseTitle}
             amount = {expemseAmount}>

             </ExpemseItem>
        </div>
            

    ); 
}

export default App;
